import React from "react";

import Curved_Arrow from '../../../1_image_or_icon/curved_arrow-icon.png'

export const My_Account = () => {

    const Default_Info_Dispenser = (section,input,FontSizeOption) => {
        return <div
            style={{
                display:'flex',
                flexDirection: 'column',
                justifyContent: 'space-around',
                backgroundColor: 'white',
                padding: '1vh 3vw',
                minHeight: '6.5vh',
                borderRadius: '10px',
                margin: '1vh 0vw'
            }}
        >

            <span
            style={{
                fontSize: '5.5vw'
            }}
            > {section}</span>
            <div>
                <img
                src={Curved_Arrow}
                style={{
                    width:'5.5vw',
                    transform: 'rotate(270deg)'
                }}
                >
                </img>
                <span
                style={{
                    fontSize: FontSizeOption,
                    position: "relative",
                    left: '1.5vw',
                    bottom: '1vh'
                }}
                >
                {input}
                </span>
                 
            </div>
        </div>
    }

    return <React.Fragment>

        <div
        className="Personalize_Data_Page_Container"
        >

        <div
        style={{
            display: 'flex',
            flexDirection: 'column',
            justifyContent: 'space-between',

            height: 'fit-content',
            padding: '5vh 0vw 5vh 7vw',
            
            fontFamily: '큐트신민상'
            
        }}
        >

        <span>profile image</span>

        {Default_Info_Dispenser('Name',' "kim" ', '5.5vw')}

        {Default_Info_Dispenser('Phone Number', '010-4876-2977', '4vw')}

        {Default_Info_Dispenser('Email_Address', 'ereh_@naver.com', '4vw')}

        {Default_Info_Dispenser('Address', '서울특별시 송파구 풍성로 14길', '3vw')}
        
        

        <span>id</span>
        <span>password</span>
        
        {Default_Info_Dispenser('Position', 'Reviewer')}

        </div>



        </div>

    </React.Fragment>

}

export default My_Account
